import React from 'react'
import './Navbar.scss'

const Navbar = () => {
  return (
    <div className='navbar'> 
      <a href="/home/buy">Home</a>
      <a href="/home/shop">Home</a>
      <a href="/">Home</a>
      <a href="#">Home</a>
    </div>
  )
}

export default Navbar
